import React from "react";
import { Redirect, Route, Switch } from "react-router";
import About from "./About";
import Home from "./Home";


const App = () => {
    return(
        <>
        <Switch>
            <Route exact path="/" component={Home}/>
            <Route exact path="/About" component={About}/>           
            <Route path="/Services"/>
            <Route path="/Contact"/>
            <Redirect to="/" />
        </Switch>
        </>
    );
};

export default App;
